import React, { Component } from 'react'


class CustomerList extends Component {
    
    render() {
        return(
        <div>
            Hello World
            <ul>
                <li>Swati</li>
                <li>Riddhi</li>
                <li>Pihu</li>
                <li>Sanjay</li>
            </ul>
            
        </div>
        )
    }
    
        
        
    }


export default CustomerList
